import React, { useState, useEffect } from 'react';


export default function Popup(props) {
    // let [shouldOpenMyDiv] = useState(false);
    // let onSelect = useState();
    useEffect(() => {
        let onSelect;
        onSelect = props.onSelect;
    }, [props.onSelect])

    const handleChange = () => {
        console.log('123')
    }

    return (
        <button className="" onClick={handleChange}>
            Hi
        </button>
    );
}
